	add("bonnet", "{\"term\":\"bonnet\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"French\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\", \"gothic\"], \"text\":\"From Middle english (1100-1500) {{m|enm|bonet}}, from Middle french (ca. 1400-1600) {{m|frm|bonet}} (Modern French {{m|fr|bonnet}}), from Old french (842-ca. 1400) {{m|fro|bonet||material from which hats are made}}, from Frankish *{{m|frk||bunni|that which is bound}}, from Proto-germanic {{m|gem-pro|*bundiją||bundle}}, from Proto-indo-european {{m|ine-pro|*bʰendʰ-||to tie}}. Compare also {{m|la|abbonis}}, {{m|la|obbonis||ribbon of a headdress}}, also of Proto-germanic origin, from Frankish *{{m|frk||obbunni}}, from *{{m|frk||ob-|above, over}} + *{{m|frk||bunni}}. Cognate with Old high german (ca. 750-1050) {{m|goh|gibunt||band, ribbon}}, Middle dutch (ca. 1050-1350) {{m|dum|bont||bundle, truss}}, Gothic {{m|got|𐌲𐌰𐌱𐌿𐌽𐌳𐌹||bond|sc\u003dGoth}}. More at {{l|en|over}}, {{l|en|bundle}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of hat, once worn by women or children, held in place by ribbons tied under the chin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, w:Margaret Margaret Mitchell, \u0027w:Gone with the Gone with the Wind\u0027, %22bonnets%22+-intitle:%22bonnet|bonnets%22+-inauthor:%22bonnet|bonnets%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dE57_TqWdPJGviQfI56CzCA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22bonnets%22%20-intitle%3A%22bonnet|bonnets%22%20-inauthor%3A%22bonnet|bonnets%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In the hall, Scarlett saw a \u0027\u0027bonnet\u0027\u0027 and put it on hurriedly, tying the ribbons under her chin. It was Melanie\u0027s black mourning \u0027\u0027bonnet\u0027\u0027 and it did not fit Scarlett\u0027s head but she could not recall where she had put her own \u0027\u0027bonnet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Russell H. Conwell, Robert Shackleton, \u0027Acres of Diamonds\u0027, %22bonnets%22+-intitle:%22bonnet|bonnets%22+-inauthor:%22bonnet|bonnets%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZTn_Tr7GIIewiQfrodCcAQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22bonnets%22%20-intitle%3A%22bonnet|bonnets%22%20-inauthor%3A%22bonnet|bonnets%22\u0026amp;f\u003dfalse page 35\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“Now,” said he, “put such a \u0027\u0027bonnet\u0027\u0027 as that in the show window.” He did not fill his show-window up town with a lot of hats and \u0027\u0027bonnets\u0027\u0027 to drive people away, and then sit on the back stairs and bawl because people went to Wanamaker\u0027s to trade\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A traditional Scottish woollen brimless cap; a bunnet\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The polishing head of a power buffer, often made of wool\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, The Editors of Popular Mechanics, \u0027Popular Mechanics Complete Car Care Manual\u0027, %22bonnets%22+car+-intitle:%22bonnet|bonnets%22+-inauthor:%22bonnet|bonnets%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dUfb_TvfIIIXjmAWnoZHnCA\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22bonnets%22%20car%20-intitle%3A%22bonnet|bonnets%22%20-inauthor%3A%22bonnet|bonnets%22\u0026amp;f\u003dfalse page 297\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Make sure that the power buffer\u0027s lamb\u0027s-wool \u0027\u0027bonnet\u0027\u0027 is clean. Change or rinse the \u0027\u0027bonnet\u0027\u0027 frequently to avoid scratching the finish. Use the \u0027\u0027bonnet\u0027\u0027 as a mitten to buff in the crevices and other areas that the power buffer can\u0027t reach\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The hinged cover over the engine of a motor car; a hood\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Jon McGregor, \u0027If Nobody Speaks of Remarkable Things\u0027, %22bonnets%22+car+-intitle:%22bonnet|bonnets%22+-inauthor:%22bonnet|bonnets%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqwcAT-WuEYSriAe_06G8AQ\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"%22bonnets%22%20car%20-intitle%3A%22bonnet|bonnets%22%20-inauthor%3A%22bonnet|bonnets%22\u0026amp;f\u003dfalse page 189\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The car is burgundy red, wide and elegant, ten years old but still the boys are impressed and they run to touch it, pressing sticky handprints against the polished bodywork and trying to climb up onto the \u0027\u0027bonnet\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, David Spencer, quoted in Don Loffler, \u0027The FJ Holden: A Favourite Australian Car\u0027, %22bonnets%22+car+-intitle:%22bonnet|bonnets%22+-inauthor:%22bonnet|bonnets%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dg_r_Ts-8IsOziQfusoWZAQ\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22bonnets%22%20car%20-intitle%3A%22bonnet|bonnets%22%20-inauthor%3A%22bonnet|bonnets%22\u0026amp;f\u003dfalse page 217\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"People were reluctant to slam a \u0027\u0027bonnet\u0027\u0027 shut in those days. One just did not slam \u0027\u0027bonnets\u0027\u0027 and doors\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Ciaran Simms, Denis Wood, \u0027Pedestrian and Cyclist Impact: A Biomechanical Perspective\u0027, %22bonnets%22+car+-intitle:%22bonnet|bonnets%22+-inauthor:%22bonnet|bonnets%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVv7_TpH8LMqaiQexrfShDA\u0026amp;redir_esc\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"%22bonnets%22%20car%20-intitle%3A%22bonnet|bonnets%22%20-inauthor%3A%22bonnet|bonnets%22\u0026amp;f\u003dfalse page 38\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"By about 20 ms, there is contact between the \u0027\u0027bonnet\u0027\u0027 leading edge and the pedestrian upper leg/pelvis on the struck side, the severity of which depends on the vehicle shape\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Stefan Aust, Anthea Bell, \u0027Baader-Meinhof: the inside story of the R.A.F.\u0027, %22bonnets%22+car+-intitle:%22bonnet|bonnets%22+-inauthor:%22bonnet|bonnets%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVAAAT_qmFKnUmAW64bXrDw\u0026amp;redir_esc\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"%22bonnets%22%20car%20-intitle%3A%22bonnet|bonnets%22%20-inauthor%3A%22bonnet|bonnets%22\u0026amp;f\u003dfalse page 308\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Stoll was still standing on the car \u0027\u0027bonnet\u0027\u0027 with the catch of his large-calibre repeating rifle off\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"A length of canvas attached to a fore-and-aft sail to increase the pulling power\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"An accomplice of a gambler, auctioneer, etc., who entices others to bet or to bid\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"The second stomach of a ruminant\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"Anything resembling a bonnet (hat) in shape or use\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A small defence work at a salient angle; or a part of a parapet elevated to screen the other part from enfilade fire\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"A metallic canopy, or projection, over an opening, as a fireplace, or a cowl or hood to increase the draught of a chimney, etc\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"A frame of wire netting over a locomotive chimney, to prevent escape of sparks\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"A roofing over the cage of a mine, to protect its occupants from objects falling down the shaft\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"In pumps, a metal covering for the openings in the valve chambers\", \"priority\":34}]}, \"synonyms\":{}}");

	add("bonnie", "{\"term\":\"bonnie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Originally an American nickname from Scottish \u0027\u0027 \u0026quot;fine, beautiful\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027 Margaret Mitchell: \u0027Gone With the Wind\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Rhett leaning over the child had said: \u0027Her eyes are going to be pea-green\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Indeed they are not,\u0027 cried Melanie indignantly, forgetting that Scarlett\u0027s eyes were almost that shade. \u0027They are going to be blue, like Mr O\u0027Hara\u0027s eyes, as blue as - as blue as the bonnie blue flag\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bonnie Blue Butler,\u0027 laughed Rhett, taking the child from her and peering more closely into the small eyes. And \u0027\u0027Bonnie\u0027\u0027 she became until even her parents did not recall that she had been named for two queens\", \"priority\":4}]}, \"synonyms\":{}}");

