	add("bonus", "{\"term\":\"bonus\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027bonus\u0027 (good)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something extra that is good\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An extra sum given as a premium, e.g. to an employee\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21579879-buy-out-firm-really-does-focus-operational-improvements-engineers Engineers of a different passage\u003dPrivate-equity nabobs bristle at being dubbed mere financiers.Much of their pleading is public-relations bluster. Clever financial ploys are what have made billionaires of the industry’s veterans. “Operational improvement” in a portfolio company has often meant little more than promising colossal \u0027\u0027bonuses\u0027\u0027 to sitting chief executives if they meet ambitious growth targets. That model is still prevalent today\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One or more free throws awarded to a team when the opposing team has accumulated enough fouls\", \"priority\":4}]}, \"synonyms\":{}}");

